import React from "react";
import { Grid, TextField } from "@material-ui/core";

export const TextFormField = props => {
  return (
    <Grid item xs={12}>
      <TextField
        fullWidth
        label={data.label}
        type={data.type}
        name={data.name}
        placeholder={data.label}
        value={null}
        onChange={null}
      />
    </Grid>
  );
};
